css:
@-moz-document domain("theyetee.com") {
.nav-main, .nav--spacer,
.account-menu, .address, .address-add--callout a, .order-listing .order-listing--link,
.module--page-header.is--white,
.order-listing-mini .order-listing--count, .order-detail, .order-detail--item:nth-child(even), .order-detail--status,
.no-subscriptions,
.collection--categories, .collection--categories .el--category,
.product-listings-mini,
.submissions--color-count .submissions--color-count-num,
.module_cart-modal .module_cart-modal--wrapper,
.module_cart-item .module_cart-item--quantity,

.sidebar, .content, .content-box
{
    background-color: #222;
}

body,
.module_cart-item,
.order-detail--item .order-detail--item-price,
.nav-main .nav-main--account .nav-main--account-icn,
.module_product-view--addon, .module_product-view--content .module_product-view--actions,
.collection--categories .el--category:focus, .collection--categories .el--category:hover,
.module_subscribe-popup,
.theme--product-listings,
.module-splash .featured-album .album-text,
.product-listing-mini:hover,
.module_cart-recommendation--item .module_cart-recommendation--item-header,
.module_cart-recommendation--item.is--featured,

.main, .content-box__row--secondary
{
    background-color: #333;
}

.main
{
    padding-left: 50px;
}

.nav-main .nav-main--cart-icn,
.module_product-listing--wrapper.is--white,
.order-detail--item .order-detail--item-price .quantity,
.theme--product-listing, .theme--product-listings.is-viewing .theme--product-listing.is-active,
.module_cart-item:after, .module_cart-item:before
{
    background-color: #444;
}

.product-listing-mini:hover .product-form-wrapper,
.nav-pagination,

.wrap
{
    background: none;
}

body,
.form input[type=text], .form input[type=password], .form input[type=email], .form input[type=tel], .form input[type=number], .form input[type=search],
.module_newsletter--form .module_newsletter--form-fields input[type=tel], .module_newsletter--form .module_newsletter--form-fields input[type=number], .module_newsletter--form .module_newsletter--form-fields input[type=search], .module_newsletter--form .module_newsletter--form-fields input[type=text], .module_newsletter--form .module_newsletter--form-fields input[type=password], .module_newsletter--form .module_newsletter--form-fields input[type=email],
.address h3, .address .address--content,
.order-listing .order-listing--link,
.order-detail--item .order-detail--item-content h3 a, .order-detail,
.address-add--callout a,
.module--text-callout .module--text-callout-content h1,
.collection--categories .el--category:focus .el--category-label, .collection--categories .el--category:hover .el--category-label,
.module_subscribe-popup .module_subscribe-popup--content .module_subscribe-popup--text h3,
.module-splash .featured-album .album-text .text h2,
.theme--product-listing .product-info h2, .theme--product-listing .product-info .read-more,
.submissions--color-count .submissions--color-count-num,
.module_collection-banner--nav a.is--active,
.module_collection-view--theme-nav-logo svg,
.module_cart-item .module_cart-item--info .module_cart-item--title, .module_cart-item--items .module_cart-item--items-header h1,
.btn.btn03,

.sidebar .order-summary__emphasis, .sidebar .payment-due-label__total, .sidebar .payment-due__price,
.content-box__emphasis, .content-box h2, .content-box h3
{
    color: #ccc;
}

.form .form--element a,
.module_collection-view--theme-nav-logo,
.module_product-view--addon .module_product-view--addon-content .module_product-view--addon-content-title,
.form .field--disclaimer, .form textarea,
.module_cart-recommendation--item .module_cart-recommendation--item-info .module_cart-recommendation--item-price,
label.check input+.check--content,

.review-block__content
{
    color: #aaa;    
}

.module_collection-view--theme-nav-logo.is--mobile svg,
.nav-main .nav-main--account .nav-main--account-icn .nav-icon,
.nav-main .nav-main--cart-icn .nav-icon
{
    stroke: #ffffff5e;
}

.module_newsletter .wave > path,
.module_product-banner .wave > path,
.module_timed-items-banner .module_timed-items-banner--backdrop .wave.wave--bottom > path,
.module--page-header .wave > path,
.module-splash .featured-album .album-img .wave,
.module_collection-banner--listings .wave > path,
.module_collection-banner--view .wave-large > path
{
    fill: #333;
}

.nav-main .nav-main--cart-icn .nav-icon .path-fill,
.nav-main .nav-logo .logo--face, .nav-main .nav-logo .logo--outline, .nav-main .nav-logo .logo--text 
{
    fill: #ffffff5e;    
}

.form input[type=text]:focus, .form input[type=password]:focus, .form input[type=email]:focus, .form input[type=tel]:focus, .form input[type=number]:focus, .form input[type=search]:focus, .form textarea:focus
{
    color: #333;
}

.order-listing-mini .order-listing--link
{
    border-color: #222;
}

.module_cart-recommendation--item
{
    border-color: #333;
}

.order-detail--item .order-detail--item-price .quantity,
.no-subscriptions,
.collection--categories .el--category,
.module_cart-item .module_cart-item--quantity,
.module_product-view--addon, .module_product-view--content .module_product-view--actions,

.content-box, .content-box__row ~ .content-box__row
{
    box-shadow: none;
    border: none;
}

p 
{
    padding: 2%;
}
}
